(4, 9, ' Ranka Aquagreens Bangalore', 'Kengeri', 'Apartment', 'savefiles/banner_1329727858.jpg', 'ranka-aquagreens-bangalore.jpg', '<p>2/3 BHK Apartment over &amp; Get Spectacular lake views Free!<br /><br />Aesthetically modelled 2/3 BHK apartments overlooking a scenic lake and a uniquely landscaped herbal garden for the nature lovers. Located in Kengeri township and spanning an area of 2 acres, Ranka aquagreens is a nature friendly residential building with 100 apartments on offer.<br /><br />Ranka Aquagreens offers its residents the perfect life by staying amidst lush greenery whilst still being just a stone&rsquo;ï»¿s throw away from the heart of all the city&rsquo;s hustle bustle.<br /><br /><br />Ranka Aquagreens - by DRA Projects<br />Ranka Group has been one of the pioneers in the residential real estate space of Bangalore. Having forayed into the construction business in the 1980s the group has changed the landscape of the city and its footprint is conspicuous in ever nook and corner of Bangalore. DRA Projects Pvt Ltd.(DRA) was later formed as an off shoot by one of the group&rsquo;ï»¿s founding members. DRA has also since grown leaps and bounds and has left an idelible mark in the real esate world by promoting South India&rsquo;ï»¿s largest integrated residential townships - L&amp;T South City with Larsen &amp; Tubro.<br /><br />DRA is credited with: <br />Building more than 10 million sqft of residential space and over 2 million sqft of commercial space. <br />Having strategic alliances with other industry majors <br />Having extensive network of industry partner all through the value chain <br />Maintaining sound and strong financials - Zero debt<br /><br /><br />Lifestyle Amenities<br />&bull; Swimming Pool &bull; Toddler Pool &bull; Gym &bull; Tennis Court &bull; Jogging Track &bull; Lakefront Landscaped Garden with Gazebos Party Hall &bull; Kids Play Area &bull; Automatic 10 Pax Elevators <br />&bull; 24X7 Security &bull; Intercom facility in each unit &bull; Piped cooking gas with gas bank in complex* &bull; Two Maids / Servants Toilets in Basement &bull; Well appointed Basement &amp; Ground Floor Lobbies &nbsp; &nbsp;</p>\r\n<center>\r\n<p>&nbsp;</p>\r\n<address class=\\"\\\\&quot;center\\\\&quot;\\"><strong>4, Ranka Chambers, </strong><br /><strong>31 Cunningham Road </strong><br /><strong>Bangalore-52.</strong><br /><br /><strong>Mobile </strong><br /><strong>9900029200</strong><br /><br /><br /><strong>Email</strong><br /><strong>marketing@draas.com</strong>&nbsp;</address></center>', '17-2-2012'),
(5, 15, 'The Empyrean', 'Whitefield', 'Villas', 'savefiles/banner_1329727794.jpg', 'image.jpg', '<p>About Project <br /><br /> The Empyrean is Bengaluru&rsquo;s FIRST TRULY INTEGRATED SUBURBAN TOWNSHIP spread across 230 acres, surrounded by 212 acres of green reserve and water bodies. With a vision to recreate the Bangalore of Yore with romantic leafy streets and lots of green and open spaces; the Empyrean is designed to provide all the comforts with a blend of modern architecture and rustic living. Master Planning of The Empyrean has been done by Aedas, the world&rsquo;s second largest architectural firm. <br /><br /> The integrated township is planned as an idyllic, green, low-rise, pedestrian-friendly and community oriented neighbourhood, with over 100 acres of open and green spaces. <br /><br />&nbsp;The Empyrean has all modern amenities including primary school, nursery school and health centre. It is well connected to the city through NH-207. Located between Whitefield and Sarjapur, it&rsquo;s just a 30 mins drive to these places. The proposed Satellite Town Ring Road (STRR) will enhance the connectivity to Bangalore International Airport and major IT hubs such as Hoskote, Whitefield, Sarjapur and Electronic City.&nbsp;<br /><br /> The Empyrean is a place for the discerning few and for those aspiring for luxurious lifestyle with lots of open spaces in the midst of nature; far enough for you to enjoy the quite serene environment away from the humdrum of busy city life. As you leave Whitefield and approach its natural settings in the countryside, The Empyrean lends an absolute change to your sense of living in a bursting-at-its-seams metro to that of entering a unique heavenly abode - Your own Paradise!!<br /><br /><br />About us - FIRE Luxur Developers Pvt. Ltd. <br /><br /> FIRE Luxur Developer is a unique attempt at creating a real estate organization with high levels of integrity and professionalism. The organization draws its strength from a highly qualified and vastly experienced team of professionals bringing together the best practices of various industries, going beyond real estate. <br /><br /> FIRE Luxur is a joint a venture of FIRE (First Indian Real Estate) Capital Fund. It is the first India-centric Real Estate fund to be registered with SEBI. FIRE Capital Fund was founded in 2004 to address a unique investment opportunity created by the coalescing of favorable economic and demographic trends, the current composition of the Indian real estate market and the fragmented nature of India&rsquo;s real estate development industry.<br /><br /> FIRE Luxur intends to create world class housing solutions - based on best technology platform available, with customer delight being the centre of all its efforts.<br /><br /> FIRE Luxur brings to you The Empyrean, luxury residences, and a place that&rsquo;s more than a home. The villas at The Empyrean are a continuing source of luxury and beauty. Located at a distance of 17 kms from Whitefield, The Empyrean will bring infinite peace and joy to your senses. Come nestle in a haven of peace and luxury.</p>\r\n<p>&nbsp;</p>\r\n<center><address><strong>FIRE Luxur Developers Pvt. Ltd.<br />\\''Regent Prime\\'', Unit No: 102<br />First Floor, Proprety Bearing No: 48<br />Whitefield Main Road, Bangalore-560066, INDIA</strong><br /><strong>Tel: </strong><br /><strong> +91 80 42860010/ 20/ 30</strong><br /><br /><strong>Email ID:</strong><br /><strong>myparadise@the-empyrean.in&nbsp;</strong></address><center></center></center>', '17-2-2012'),
(6, 11, 'Sowparnika Chandrakantha', 'Chandapura', 'Apartment', 'savefiles/banner_1329727684.jpg', 'Sowparnika-chandrakantha-300x190.jpg', '<p>About the project Sowparnika Chandrakantha<br /><br />Chandrakantha is the 22 project from sowparnika projects &amp; Infrastructure pvt ltd. Chandrakantha is located in Chembanahalli village near Dommasandra in Sarjapur Road , it&rsquo;s a 140 unit apartment with 35 flats on each floor ,G+3. Elegant, spacious and refined homes for the discerning few, who love to dream, live and enjoy life like never before. The most affordable masterpiece on Sarjapur road is yours for the taking. Spread on a sprawling and serene acre, 140units of refined living spaces crafted to fulfill your need for space and comfort beckon. Well-planned with pathways and landscapes make living here a delight. Each and every unit is Vaastu compliant with adequate ventilation; fantastic facilities and most importantly strategically located at the most happening part of Bangalore.<br /><br /><br />Amenities<br />Swimming pool , Club house, Children&rsquo;s play area, 24 hrs power back-up, A/C, Gym, Park , Jogging track, Landscaped gardens on all floor, Sewage treatment plant &amp; solar water</p>\r\n<p>&nbsp;</p>\r\n<center><address><strong>Contact Us</strong><br /><strong>52/1 CHEMBANAHALLI</strong><br /><strong>NEAR DOMMASANDRA</strong><br /><strong>ANEKAL TALUK</strong><br /><strong>SARJAPUR MAIN ROAD</strong><br /><strong>BANGALORE - 560125</strong><br /><br /><strong>Contact No.</strong><br /><strong>+91 8861000456</strong><br /><strong>+91 9663614113</strong><br /><strong>+91 9663614115&nbsp;</strong></address><center></center></center>', '17-2-2012'),
(7, 6, 'Sanguine Homes', 'Electronic City', 'Villas', 'savefiles/banner_1329727599.jpg', 'image-20.jpg', '<p>ABOUT THE PROJECT<br /><br />SANGUINE HOMES NEAR ELECTRONIC CITY BENGALURU<br /><br /> The fast paced development, globalization and highly competitive work environment has left most of us in a state of tremendous stress, strain and fatigue. In the present scenario, is it not a big dream to wish for a home amidst serene surroundings, tranquil and pollution free environment of soothing greenery? After a day&rsquo;s of enormous hard work, if you desire to have the luxury of such a home to relax - we are glad to announce that we have a solution - &ldquo;Sanguine Homes&rdquo;.<br /><br />&ldquo;Sanguine homes&rdquo; is an exclusive gated community with a limited number of cozy independent villas. We are very proud to say that &ldquo;Sanguine Homes&rdquo; is situated amidst a dream like setting of rich, lush green surroundings and pollution free environment. Though unbelievable, it is within close proximity to the core city of Bangalore. It is located at just 4 kms from WIPRO in electronic city and less than 1 km from HCL (SEZ) in Jigani industrial area. We, as a team of professional civil engineers, assure you of immaculate planning - all according to vasthu and thorough professional excellence in execution to produce a villa of best quality. Further more,Sanguine Home&nbsp;is supported by the luxury of fully loaded amenities with cent percent functional utility to the limit of one&rsquo;s imagination. All this is being offered at quite a reasonable price. To say in one line, it would be certainly be the best bet and worth its value to buy a villa at Sanguine Homes considering the location and the quality of the product.<br /><br /> It needs a little effort from your side to believe all this - have a glance at the few of our photographs pertaining to our earlier venture posted herein and take out some time visit our project site.<br /><br /><br />HIGHLIGHTS<br /><br /> - Exclusive Gated Community<br /> - Cozy Duplex Villas<br /> - Rich &amp; Lush Green Surroundings<br /> - Pure &amp; Pollution Free Environment<br /> - Value for Money (100%)</p>\r\n<p>&nbsp;</p>\r\n<center><address><strong>Contact Us</strong><br /><br /><strong>Mr. Mohan Babu</strong><br /><strong> +91 99866 98033</strong><br /><strong>E-mail: mohan@vintcs.com</strong><br /><br /><strong>Office:</strong><br /><strong> 332, 1st Floor, 6th Main,</strong><br /><strong> 6th Sector HSR Layout,</strong><br /><strong> Bengaluru - 560 102</strong><br /><strong>Url: www.vintcs.com</strong><br /><strong>E-mail: info@vintcs.com&nbsp;</strong></address><center></center></center>', '17-2-2012'),
(8, 23, 'Brindavan Gardens', 'Anekal', 'Villas', 'savefiles/banner_1329727507.jpg', 'srr-daisy-villa.jpg', '<p>About Project<br /><br />Brindavan Gardens is a BMRDA-approved residential layout (LAO/92/2008-09), spread over 26 acres in First Phase and future plans (total 90 acres). Our community is conveniently located and accessible to the most vital areas of Bangalore City, including Electronic City, BIOCON, Bannergatta Road, Sarajpura, SIPCOT industrial area of hosur town and the proposed SEZ of hours. Also centrally located for easy transportation to major educational institutions, such as Sarala Birla Academy, Alliance Academy, Shridhi Sai Engineering College, etc. Within walkable distance to Anekal Railway Station, to which METRO rail service is proposed.</p>\r\n<p>Amenities<br /><br />&bull; All roads with street lights &amp; Asphalted roads. <br />&bull; More thane 45% of free for Roads, Parks and Civic amenities. <br />&bull; Underground water supply and sewage line connected to each plot. <br />&bull; 24 hour security arrangement for the entire layout. <br />&bull; Electricity connection. <br />&bull; All round compound wall built for the entire layout. <br />&bull; Waste water harvesting system <br />&bull; Club house with modern facility and health care equipments <br />&bull; Swimming pool and jogging track <br />&bull; Exclusive childrens park and play area<br /><br /><br /><br />Customer Pleasing Features<br /><br />&bull; On 300 Ft (Existing state High way) <br />&bull; Walk able distance to anekal railway station. <br />&bull; Close to alliance academy &amp; Shrdi sai Engineering College. <br />&bull; 10 Minutes drive from Srarala Birla Academy. <br />&bull; 12 Minutes drive from Electronic city &amp; Elevated Express Higway (Fly Over) <br />&bull; Very Frequent train services from Banglore city,Anekal-Devenahalli(Via Yeshavanthpura) and Hour. <br />&bull; Metro train services expected very soon at Anekal railway station. <br />&bull; Villa plots ready for construction.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<center><address><strong>Contact Us</strong><br /><br /><strong>SRR Homes. </strong><br /><strong>498/C, 15th Main, </strong><br /><strong>15th Cross, 4th Sector, </strong><br /><strong>HSR Layout </strong><br /><strong>Bangalore -560102, India</strong><br /><br /><strong>Email: sales@SrrHomes.in </strong><br /><br /><strong>Brindavan Gardens / Exurbia: </strong><br /><strong>Kavitha : 9008600435 </strong><br /><strong>Sanjeer : 9008600431&nbsp;</strong></address><center></center></center>', '17-2-2012'),
(9, 10, 'Century Linea', 'Jakkur', 'Apartment', 'savefiles/banner_1329727426.jpg', 'elev-image.jpg', '<p>PROJECT DETAILS</p>\r\n<p>&nbsp;<br /> A luxurious, aesthetic and environment-friendly home planned with a profound understanding of you. That is Century Linea in Jakkur. The thoughtful design ensures excellent cross ventilation and naturally well-lit interiors. The clean and serene environs refresh life. The easy access to prominent points and utilities in the city make life easy. The wide ranging and world class amenities spell pride.<br /> The attention to detail is remarkable. Simply put, Century Linea is everything you wished for. And more.</p>\r\n<p><br />FACILITIES &amp; AMENITIES</p>\r\n<p><br />Facilities &amp; Amenities | Clubhouse | Multi-purpose hall | Health club | Stroll way Swimming pool | Water supply | Stand-by-power | 24x7 security</p>\r\n<p>&nbsp;</p>\r\n<center><address><strong>&nbsp;</strong></address><center></center></center>', '17-2-2012'),
(10, 13, 'Bindu Promoters And Developers', 'Magadi Road', 'Apartment', 'no.jpg', 'elevation1.jpg', '<p>Overview<br /><br />Bindu Promoters and Developers offers luxurious flats at BEL Layout, Magadi Main road, Bangalore. These 2 &amp; 3 BHK apartments provide high quality and modern lifestyle. All the apartments are vasthu compliant. Deluxe Duplex Units are designed &amp; styled as an independent houses incorporating the security feeling of an apartment.</p>\r\n<p>Type BHK Size Price</p>\r\n<p><br />Apartments 2 BHK 1067 sq. ft. Rs. 28,22,064<br />Apartments 2 BHK 1121 sq. ft. Rs. 30,25,509&nbsp;<br />Apartments 3 BHK 1422 sq. ft. Rs. 38,00,915&nbsp;<br />Apartments 3 BHK 1438 sq. ft. Rs. 38,41,776&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><br /><br /><br /><br />Features:</p>\r\n<p><br />Gymnazium<br />Swimming Pool<br />BDA approved<br />Intercom facility<br />Water softing plant<br />Separate Visitor Parking<br />Power backup<br />Lift<br />Sweage treatment plant<br />Park<br />Reserved Parking<br />Security<br />100 % Vasthu compliant<br />Private Terrace / Garden<br />No common walls / 3d ventilation <br /><br />Location Advantages</p>\r\n<p><br />10 Kms. from Railway Station<br />1 Km from hospital<br />40 kms from the Airport<br />1 km from the School<br />1.5 km from NICE road<br />2 km from Ring road<br /><br />Specifications for Apartments</p>\r\n<p><br />Structure <br />Seismic Zone II Resistance R.C.C frame structure with anti-termite<br /> treatment for the entire plinth.<br />Walls: <br />External &amp; internal walls of compressed concrete solid blocks masonry with cement mortar<br />Plaster: <br />External walls cement plaster with sponge finish &amp; internal walls with lime rendering smooth finish<br />Lobby and staircase with kota-stone</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<center><address><strong>Bindu Promoters and Developers</strong><br /><strong>#30/4, 46th Cross, 4th Block, Rajajinagar,</strong><br /><strong>Bangalore-560010.</strong><br /><strong>Ph: 23101354/55 </strong><br /><strong>Mobile : Dixit Shah: 9886833766</strong><br /><strong>Nainesh Shah: 9980132970 </strong><br /><strong>Email : bindu_999@rediffmail.com&nbsp;</strong></address><center></center></center>', '17-2-2012'),
(11, 0, 'Grandeur', 'Hebbal', 'Apartment', 'savefiles/banner_1329727141.jpg', 'elevation2.jpg', '<p>Grandeur offers 2 / 3 BHK residential apartments in Bangalore. It is truly a modern residential complex, with 60 flats conceived and constructed aesthetically, keeping your convenience in mind. Close to Hebbal road, it&rsquo;s just few minutes away from your work place.<br /><br />Grandeur is located close to Manyata Tech Park, Lumbini garden and other software companies.</p>\r\n<p>Amenities</p>\r\n<p><br />Large swimming pool<br />Amphitheater<br />Health club<br />Library room<br />Guest room<br />Childrens play area<br />24x7 security<br />Landscaped area<br />Exclusively designed seperate club house<br />Indoor games<br />Location Advantages<br />Over looking Manyata Tech Park<br /> Overlooking Rachenahalli Lake<br />Close to Outer Ring road<br /> Close to upcoming Metro station<br /> Close to major hospitals, schools, Banks etc.<br /> Connected to the International Airport.</p>\r\n<p><br />Specifications</p>\r\n<p><br />Structure <br />R.C.C frame earth quake resistance structure<br />Walls <br />6&rdquo; cement solid blocks for exterior wall and 4&rdquo; solid block for internal walls<br />Flooring <br />Vitrified tiles flooring for living, dining and kitchen<br />Ceramic tiled flooring for balconies<br />Doors <br />Main door with seasonable teak wood frame with teak wood shutters and internal doors sal wood frame flush shutters<br />Kitchen <br />Black granite kitchen platform with stainless steel sink 2 ft. height dadoing in ceramic tiles<br />Electrical Work <br />Copper wiring with Anchor / Havel&rsquo;s cables with Anchor rider switches<br />TV and telephone points in the living room and master bedroom&nbsp;</p>\r\n<center><address><strong>Contact Us</strong><br /><br /><strong>ATZ Properties</strong><br /><strong> 12/1, Plain Street, </strong><br /><strong>&nbsp;Infantry Road Cross, Bangalore</strong></address><address><strong>9686031122&sbquo;9686011122&nbsp;</strong></address><center></center></center>', '17-2-2012'),
(12, 16, 'Shri Diya Vilola', 'Sarjapur Road', 'Apartment', 'savefiles/banner_1329723830.jpg', 'el4.jpg', '<p>Set on the hottest location of Bangalore, Sarjapura Main Road. SHRI DIYA VIOLA is a 110 apartment complex spread over 2 acres of land. Having 5 blocks in its sprawiling complex, SHRI DIYA VIOLA consists of luxury 2, 3 @&amp; 4 BHK spacious apartment.</p>\r\n<p>&nbsp;</p>\r\n<p>SHRI DIYA VIOLA aims to amplify the living standards of its residents by providing international standard facilities, superior infrastructure and high quality which really remain unmatched its class.<br /><br /> Being located 10 kms after Wipro corporate office off Sarjapura Main Road. The project is close to IT Hub of South Bangalore, Malls, Hospitals, Recreational Venues and major international class Education Institutions like DPS, TISB, Greenwood High, Inventure Academy, Indus International School ect.<br /> Quality, luxury and value being the core propositions of the project, it&rsquo;s just more than a wonderful experiance being a VIOLA-ite!<br /> Also, because of the presence of various IT, ITES, Non-IT Companies, MNCs, SEZs in South Bangalore; your investment in SHRI DIYA VIOLA would ensure high appreciation in the future.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<center><address><strong>Contact Us</strong><br /><br /><strong>Shri Diya Projects Pvt. Ltd.</strong><br /><strong> #180, 1st Floor, 8th Main, </strong><br /><strong> 14th Cross, 6th Sector, H.S.R. Layout, </strong><br /><strong> Bangalore - 560102&nbsp;</strong></address><address><strong>M.: + 91 - 9900028966 / 68</strong><br /><br /><strong>Tel.: + 91 - 80 - 25729501</strong><br /><br /><strong>Email: shridiyaprojects@gmail.com&nbsp;</strong></address><center></center></center>', '17-2-2012'),
(13, 7, 'Upkar Estates', 'Attibele', 'Apartment', 'savefiles/banner_1329728109.jpg', 'J290380011.default.79737.jpg', '<p>Upkar Estates is in the field of real estate development since 1974 and has grown considerably by leaps and bounds erecting customized buildings to suit the demands at work place, dwelling and relaxation centers thus catering to every specific need of the property buyers. Over the decades there have been considerable market fluctuations &ndash; booms and crashes, in every field. The real estate business was no exception. Very few companies survived these ravages. Among them that stand tall and strong is Upkar. In a City that has come to accept the fact that the real estate comes only at a premium, this Company&rsquo;s policy &ndash; &lsquo;highest quality at a reasonable cost&rsquo; came in as an attractive and refreshing change and that was received well by one and all. Upkar is into both development of well planned, exquisitely landscaped residential Layouts with all amenities and construction of elegantly designed villas and apartments at convenient locations keeping cost and comfort in mind.&nbsp;<br /><br />Upkar Oakland is one of the popular Residential Developments in Hosur road neighborhood of Bangalore. It is among the well known Projects of Upkar Estates. The landscape is beautiful with spacious and over 92 Houses.Upkar Okland located on Hosur Main Road just 10 kms from IT Hub Electronic City,it has 92 ultra luxery apartment with all facilities like Swiming pool,Gym,Departmental stores,Club house etc..Project Approved by BMRDA,Project also approved by all leading Bank.We have 2 and 3 Bhk apartments build area from 1069 sft to 1596 sft .<br /><br />Location Advantages:<br />located on Hosur Main Road just 10 kms from IT Hub Electronic City.<br />*Close to Public Transport<br />*Close to Shopping Area<br />*Prime Location<br />*Convenient Location<br />*It is minutes away from the best international schools.<br />*Nearby a number of Hospitals.<br />*In a close proximity there are a number of shopping malls and business park.<br /><br />Lifestyle Amenities:<br />* Swimming Pool<br />* Play Area<br />* 24Hr Backup<br />* Security<br />* Club House</p>', '17-2-2012'),
(15, 26, 'Prestige Oasis', 'Doddaballapur', 'Villas', 'savefiles/banner_1332227051.jpg', 'elevation-small.jpg', '<p>&nbsp;</p>\r\n<p><strong>Prestige Oasis - Overview</strong><br /><br />Leave behind the deafening sounds of vehicle horns and shrill calls of your local roadside vendor, and re-locate to Prestige Oasis, at Yelahanka. One of Bangalore&acute;s finest and most lavish residential properties! The 186 Villas have been aesthetically set over the 33 acre property, making them seem just as rhythmic and graceful as the Japanese Haiku (a lyrical 3-line ode to nature).<br /><br />Aside from every modern amenity and facility that would be characteristic to an exclusive enclave such as the Prestige Oasis, were sure what you will appreciate the most, is the fresh, pollution-free air and serenity this beautiful piece of paradise offers. If you are considering buying a Villa in Bangalore, Prestige Oasis is the place you need to be at, a property that epitomizes The art of peaceful living.</p>\r\n<p><br />Quick facts:<br />Location: Doddabellapur, Bangalore <br />Development Type: Independant Villas <br />Development Size: 33 Acres<br /> Number of Units: 186 Villas<br /> Price: Sky Villas start from 1.90 Crores</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Prestige Estates Projects Ltd. </strong><br /><strong> The Falcon House, No. 1, </strong><br /><strong> Main Guard Cross Road,</strong><br /><strong> Bangalore - 560 001. </strong><br /><strong>Tel: 00 91 80 25591080</strong><br /><strong> Fax: 00 91 80 25591945</strong>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿</p>', '20-3-2012'),
(16, 12, 'Eta Star The Gardens', 'Magadi Road', 'Apartment', 'savefiles/banner_1332240458.jpg', 'elev_side2_th.jpg', '<p>In Bangalore for the first time, ETA Star has recreated the Bangalorean way of life in the heart of the city. Christened The Gardens, in ode to Bangalore, this wondrous offering gives you all the comforts of old Bangalore, while letting you enjoy the advantages of its present day avatar.&nbsp;<br />&nbsp;Starting with a location that&rsquo;s right in the heart of the city, this forest haven is just 1.2 km away from Majestic and Bangalore&rsquo;s city Railway Station and barely 5 km from Vidhana Soudha.&nbsp;<br /><br />&nbsp;Sitting pretty on Magadi Road, The Gardens transport you to old Bangalore where you can leave just a few minutes early for a night out, where your home is just minutes away from the city&rsquo;s pulsing core and where amenities like supermarkets are within hopping distance. The Gardens also transport you to a time when lush gardens and an environment of complete peace and quiet, when the most common noises you hear aren&rsquo;t blaring horns, but the twittering of birds, the giggles of your children playing, and the amused murmurs of your parents taking a stroll.&nbsp;<br />&nbsp;And where not only do you have more time to enjoy life in, you have the inclination to enjoy it in as well. Where you&rsquo;re eager to enjoy every moment of it and are filled with a sense of well-being.&nbsp;<br />&nbsp;In fact, where it feels like you&rsquo;re back home. In Bangalore.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>The Gardens</strong><br /><br /><br /><strong>The Gardens, No.9, </strong><br /><strong> Binny Ston Garden, </strong><br /><strong> K.P. Agrahara, Magadi Road,</strong><br /><strong> Bangalore- 560 023</strong><br /><br /><strong>e-mail: thegardens@etastar.com</strong><br /><br /><strong>Ph No: +91 80 2314 1844,</strong><br /><strong> +91 80 65356911/12/13&nbsp;</strong></p>', '20-3-2012'),
(17, 8, 'Shriram Suhaana', 'Doddaballapur Road', 'Apartment', 'savefiles/banner_1332319649.jpg', 't5_1818837_wlktz_940.jpg', '<p>Overview of luxury apartments; Doddaballapur Road, Yelahanka<br /><br />Far from the hustle and bustle of the city&rsquo;s activities and in the midst of serene surroundings stands Shriram Sahaana - home close to your dear ones and your heart.<br /><br />Live a melodious way of life at Sahaana! Shriram Sahaana is spread across 7 acres of pristine land located on Doddaballapur Road, Yehalanka. This apartment in Bangalore is in close propinquity to the Bangalore International Airport and some of the popular schools, colleges and hospitals.<br /><br />Homes to offer:<br /><br />Shriram Sahaana has 364 luxury apartments located amongst lush green vicinity. The apartments are constructed on an area ranging from 1208 sq. ft. to 1781 sq. ft. offering 2 and 3 BHK apartments which suit the requirements and budget of our customers. Each room has adequate space with good ventilation and we have also ensured that every apartment is Vastu compliant.</p>\r\n<p>Our offering would make your apartment in Bangalore an ideal home for your family<br /><br />All the apartments, be it in Shriram Suhaana or our other apartments in Bangalore, are fitted with quality fixtures to give you a feel of a perfect home. Be it the flooring or doors, electrical accessories or bathroom fittings, we have ensured that nothing comes in the way when it comes to quality.</p>\r\n<p><br />Super Structure : RCC frame structure<br />Vitrified Flooring: Superior quality in foyer, living, dining, kitchen &amp; bedrooms.<br />Laminated wooden flooring: Master bedroom only.<br />Ceramic Flooring: For balconies, toilets &amp; utility area.<br />Ceramic Wall Tiles: Superior quality ceramic wall tiling up to false ceiling, up to sill in utility area.<br />Kitchen : Open kitchen with granite platform and breakfast counter.<br />Fittings : Combination of Florentine &amp; Lyric from Jaguar<br />Sanitary Wares: Hind ware- Floor mounted coupled closet &amp; shower.<br />Cubicle in master bedroom.<br />Counter wash basin: In all toilets.<br />Main Door: Teakwood frame with BST shutters.<br />Bedroom &amp; toilets doors: Sal wood frame with skin type flush shutters.<br />Living/family &amp; master bedroom balcony: French door-cum-window.<br />Windows: UPVC.<br />Hard ware fittings : Superior fittings with cylindrical locks.<br />Electrical: Power-5KW, DG back up-1KW<br />Electrical switches: Modular.<br />Internal painting: Partly OBD &amp; partly emulsion &amp; texture paint in common area till sill level.<br />External Painting: Combination of emulsion &amp; textured painting.<br />Common Area Flooring: Granite flooring <br />Videophone: All flats<br />Elevators: 8 passengers &amp; 13 passengers</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Shriram Properties Limited</strong><br /><strong> No 40/43, 8th Main, 4th Cross, RMV Extn, </strong><br /><strong> Sadhashiva Nagar</strong><br /><strong> Bangalore - 560 080</strong><br /><strong> Karnataka</strong><br /><strong> Phone : +91 80 4022 9999 </strong><br /><strong> Fax : +91 80 4123 6222 </strong><br /><strong> E-Mail : enquiryblr@shriramproperties.com&nbsp;</strong></p>', '21-3-2012'),
(19, 5, 'Prestige Garden Bay', 'Yelahanka', 'Villas', 'savefiles/banner_1343724064.png', 'garden-bay-entrance-small.jpg', '<p>Prestige Garden Bay - Overview<br /><br />An intimate and elegant community of townhouses awaits you at Prestige Garden Bay in Yelahanka, North Bangalore. Set across 6.2 acres of lush, landscaped verdure, Garden Bay promises a life that glides through luxury with peace reigning all around!<br /><br />The development is completed with 184 homes, spread across 8 blocks, of 5 storey&rsquo;s each&hellip; Spacious four bedroom duplexes with private gardens and commodious three bedroom homes make up this new Prestige project! <br /><br />Needless to say, as all other developments from Prestige, Garden Bay too comes with their stamp of unqualified class&hellip; Which means that you can expect within this residential development as well, lifestyle amenities that include a Gym, a Rooftop Party Hall, a Theatrette, a Toddlers Cr&egrave;che, a Lawn Tennis Court, an Indoor Squash and Badminton Court, a Basketball Practice Court, a Swimming/Wading Pool, a Health Club, Billiards and Table-Tennis Tables and a dedicated Children&rsquo;s Play Area.<br /><br />So, come discover a life of leisurely luxury at Prestige Garden Bay!<br />Quick facts:<br />Location: Yelahanka, Bangalore<br />Development Type: Townhouses (4 Bed Duplexes &amp; Spacious 3 Bedroom Homes)<br />Development Size: 6.2 Acres<br />Number of Units: 184 Homes, in 8 Blocks (5 Storey Each)<br />Price: Townhouses starting from 86 Lakhs</p>\r\n<p>Prestige Garden Bay - Contact<br /><br />Prestige Garden Bay is an elegant community of apartments, located in Yelahanka, minutes off the Yelahanka Police Station, Bangalore... The project comprises of 184 units that are spread across 8 Blocks of 5 Storey\\''s each. The apartment comes with 4 bedroom duplexes &amp; spacious 3 bedrooms...<br /><br />For more details on the same, feel free to get in touch with our Team on the numbers below &amp; Add Prestige to your life&hellip;<br />Mr. Saleem: +91-97418 70756<br />Mr. Sameer: +91-96111 91251&nbsp;</p>', '31-7-2012'),
(20, 3, 'Palm Meadows ', 'Whitefield', 'Villas', 'savefiles/banner_1343977761.png', 'timg_3.jpg', '<p>An old world &ndash; in a new city&nbsp;<br /><br /> <br /><br /> Luxury homes crafted to suit your personal taste in a truly beautiful setting offer a lifestyle that is both exclusive and superior. A state of the art clubhouse nestled in lush green, and world-class amenities complete this exquisite portrait of soulful living. <br /> <br /><br /> Owing to the demand that has been generated for Adarsh Palm Meadows villas, we at Adarsh Group are planning on an extension of the Palm Meadows. A few of our select clients will be a part of this extension. We will be extending the same facilities that the present Palm Meadows customers are enjoying to the new customers as well. The same quality of construction and lifestyle will be extended to the new customers. <br /> <br />Plots Size: 3,500 to 5,130 sq.ft<br /> Independent Villas Sizes: 2,817 to 3,645 sq.ft<br /> Address: Airport Varthur road, Whitefield, Bangalore- 560066<br />Nearby Vicinity: Palm Meadows is well connected to important landmarks in the city.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Adarsh Developers <br /> 10, Vittal Mallya Road, <br />Bangalore 560001 <br /> India<br /> <br />Telephone No: 080- 41343310, 4134 3400, 3309, 3310<br /> <br />Fax No: 080 2221 8565<br /> <br />Email Id: marketing@adarshdevelopers.com&nbsp;</p>', '3-8-2012'),
(21, 25, 'Adarsh Serenity', ' Whitefield', 'Villas', 'savefiles/banner_1343978360.jpg', 'timg_1.jpg', '<p>Adarsh serenity</p>\r\n<p>&nbsp;</p>\r\n<p>Out of this world, but never out of touch<br /> <br /> Adarsh Serenity is a perfect place to rejuvenate your soul; immerse yourself in the serene green expanse as you pamper yourself with the amenities that surround you.<br /><br />A beautiful project of luxury villas spread over 25 acres of lush green landscape; it is the latest feather in our cap. Villas that are not only custom-made but also come with a bouquet of amenities that are so unique to any Adarsh project. Be a part of the greenest landscapes in Bangalore and a well-connected address.<br /> <br />Budget: 1.7 crores and above<br />Total Area: 25 acres<br /> Plot Area: 3,150 &ndash; 8,224 sq.ft<br />Built-up Area: 2,210 - 5,100 sq.ft<br />Address: Kannamangala, Whitefield<br />Nearby Vicinity: Satya Sai Ashram, IT Park<br /> <br /><br /> <br />Approved by: LIC Housing Finance &amp; Other HFI\\''s</p>\r\n<p>Adarsh Developers&nbsp;<br /> 10, Vittal Mallya Road, <br />Bangalore 560001 <br /> India<br /> <br />Telephone No: 080- 41343310, 4134 3400, 3309, 3310<br /> <br />Fax No: 080 2221 8565<br /> <br />Email Id: marketing@adarshdevelopers.com&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>ï»¿ï»¿<span>ï»¿</span></p>\r\n<p>ï»¿ï»¿<span>ï»¿</span><br />&nbsp;</p>', '3-8-2012'),
(22, 4, 'Godrej Platinum', 'Hebbal', 'Apartment', 'savefiles/banner_1343990361.png', 'platinum_brochure.jpg', '<p>A home made especially for you<br /><br />Live out the precious moments with your loved ones surrounded by all of life\\''s luxuries. Admire the panoramic views of the Hebbal Lake and all the greenery around it. Godrej Platinum is more than just a home. Godrej Platinum is where you pamper yourself, your family and your guests. <br />Area between 2,900 sq. ft. and 3,900 sq. ft.<br />Efficient Design<br />Double-height balcony<br />Designed to maximize cross ventilation<br />10\\'' floor to ceiling height<br />Attached staff room<br />Overnight facilities for support staff<br />Landscaped garden<br />Friendly design for the differently abled<br />State of the art clubhouse<br />Temperature controlled indoor swimming pool<br />AC provision for all the rooms<br />Convenience store<br />Dedicated cr&egrave;che space</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Godrej Properties Ltd.,<br />Godrej Platinum,<br />International Airport Road,<br />Hebbal, Bengaluru - 560024, India<br /> Telephone: +91- 80- 67617800<br /> Mobile: +91- 95389 23767/97424 14100<br /> Email: platinum@godrejproperties.com&nbsp;</p>', '3-8-2012'),
(23, 17, 'Sri Mitra Spring Valley', 'Sarjapur Road', 'Apartment', 'savefiles/banner_1344589553.png', 'Sri mitra springs.jpg', '<p><span style=\\"font-size: medium;\\"><strong>Sri Mitra Spring Valley<br /></strong></span></p>\r\n<p>ï»¿ï»¿ï»¿ï»¿location advantages<br /><br />Wipro corporate office 1.5 kms <br />Total mall &frac12; km <br />Indus school 5 kms <br />Sessana tech park 4 kms <br />Bangalore central 1 kms <br />Intel 5 kms <br />Koramangla 3 kms <br />St. Johns hospital 5 kms <br />Electronic city 8 kms <br /><br />pricing details <br /><br />basic cost 3900/- per sq.ft [nego]<br /><br />addtional charges<br /><br /><br />car parking 200000/-<br /><br />bwssb &amp; kptcl rs 180/- per sq.ft<br /><br />amenties 150000/-<br /><br />VAT &amp; SERVICE TAX 8% ON basic and car parking<br /><br />registration charges extra&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>LAXMIKANTH/SHAFIQ<br />NATURAL HOMES<br />[ASSOCIATES OF SRI MITRA BUILDERS &amp; DEVELOPERS AND SAI SUNSHINE]<br />9972119080&nbsp;</p>', '10-8-2012'),
(24, 18, 'Sai Sunshine', 'Bellandur', 'Apartment', 'savefiles/banner_1344925439.png', 'sai.jpg', '<p>PROJECT OVERVIEW<br /><br /> <br /><br />SAI SUNSHINE is an ongoing project on located on BELANDUR near to SHOBHA PROJECTS AND BELANDUR LAKE . The location lies in the heart of an IT corridor by the proposed 80 feet road that connects OUTER RING ROAD. The site is 0.8 kms. away from the OUTER RING ROAD. This area has seen rapid development in last few years due to the coming up of various offices, commercial complexes and schools which led to multiple residential projects being developed on BELLANDUR.<br /><br /> <br /><br />Each flat in SAI SUNSHINE is airy and bathed in light with INDEPENDENT WALLS. The elegance of your home merges with the beauty of its surroundings. These homes are designed to reflect the essence of living, in a space that is warm &amp; cozy.<br /><br />The minimalist styling will truly allow you to enjoy the beauty of your home.<br /><br />Nestled away from chaos and pollution, yet close to all needs a human being must require to lead a happy life. to name a few project is surrounded by salapuria tech park , 2000 posh sobha apartment with modern amenities jogging park , children play ground rain water harvesting , gym with equipment, intercom facility from each to security room security room , toilet in car parking area , optimum space utilization, covered car parking and walkable bus stop with frequent all types of buses to reach any corner of bangalore.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>shobha projects, salarpuria tech park, shobha club house ,hdfc and icici banks and atms, narayaana college ,0.8 kms from outer ring road, belandur lake, bangalore central shopping mall , close to sarjapura main road, 1.5 kms from eco space software, 1 km from cap gemini company.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>SHAFIQ / LAXMIKANTH REDDY<br />SALES MANAGER<br />SRI MITRA BUILDERS &amp; DEVELOPERS<br />9972119080&nbsp;</p>', '14-8-2012'),
(25, 19, 'S V Lake View', 'Sarjapur Road', 'Apartment', 'savefiles/banner_1344926157.png', 'sl.jpg', '<p>S V lake view apartment</p>\r\n<p>The tints of architectural beauty<br /><br /> <br /><br /> Those discerning often have concerns about a flat- Is it too crowded? Are there too many people and vehicles? Will it have the privacy we require?<br /><br /> Lake view is a perfect blend of both- It has the freedom of an independent home with the security and infrastructure you require.<br /><br /> There are 36 exquisitely designed flats.<br /><br /> Each home at lake view is well designed reflecting the best in contemporary design. Things like good material and good ventilation are given. Vaastu is adhered in the best possible manner. Exteriors are artistically landscaped spaces with gym and multipurpose hall and open space. The overall ambience is calm, refreshing and rejuvenating -Something that you would expect from a home.<br /><br /> <br /><br />Colourful living&hellip;..well within reach&hellip;<br /><br />Accessibility. Convenience. Value appreciation. This at least explains the premium position of S.V.Lake view close to the IT hub, a stone throw distance from multiplex and fabulous malls, a bird&rsquo;s eye view away from the best schools and with the largest MNCs as your neighbours, this is the closest that you can get to the future. And what&rsquo;s more? The rind road keeps you connected to the Electronic City and also you are minutes away from the heart of the city.<br /><br /> <br /><br /><br /> Pricing details <br /><br /> <br /><br />Basic cost 3200/- per sq.ft [nego]<br /><br /> <br /><br />Additional charges<br /><br /> <br /><br />car parking 2,00,000/-<br /><br />bwssb &amp; kptcl rs 2,00,000/- <br /><br />amenities 1,30,000/-<br /><br />VAT &amp; SERVICE TAX 8.2% ON basic and car parking<br /><br />Registration charges extra<br /><br /> <br /><br /> <br /><br /> <br /><br /> <br /><br /> <br /><br />Banks approved<br /><br /> <br /><br />LIC <br /><br />CORPORATION<br /><br />HDFC<br /><br />AXIS<br /><br /> <br /><br />Project completion date January 15th 2013<br /><br />Sizes available<br /><br />G+3<br /><br />1st = ground<br /><br />2bhk &ndash; 1245 sq. ft [1,2,3,4]<br /><br />2bhk &ndash; 1275 sq.ft [1,2,3,4]<br /><br />3bhk &ndash; 1670 sq.ft [1,2]<br /><br />3bhk &ndash; 1720 sq.ft [1,2,3,4]<br /><br />3bhk &ndash; 1795 sq.ft [1]<br /><br />3bhk - 1820 sq.ft [1]</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>SHAFIQ / LAXMIKANTH REDDY<br />SALES MANAGER<br />SRI MITRA BUILDERS &amp; DEVELOPERS<br />9972119080&nbsp;</p>', '14-8-2012'),
(26, 20, 'Sri Mitra Symphony ', 'Hoodi Circle', 'Apartment', 'savefiles/banner_1344927797.png', 'sri.jpg', '<p>&nbsp;</p>\r\n<div>\r\n<p><strong>ABOUT SRI MITRA BUILDERS &amp; DEVELOPERS</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp;Welcome to Sri mitra Builders and Developers, leading real estate developers for residential and commercial properties. With over 10 years of experience and expertise, Sri mitra Builders and Developers maintain a carefully created legacy of excellence, quality and customer satisfaction. We have developed many properties with immense success.</p>\r\n<p>Sri Mitra Builders has launched a new project Sri Mitra Symphony at HOODI circle near ITPL in Bangalore.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ABOUT SRI MITRA SYMPHONY</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Overview</strong>&nbsp;:-</p>\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;Sri mitra&nbsp;&rsquo;&rsquo;<strong><cite>Symphony&rsquo;&rsquo;&nbsp;ï»¿&nbsp;</cite></strong>is the area&rsquo;ï»¿s mostï»¿&nbsp;enchanting new gated community, designed with the resident in mind with generous living space and imaginative floor plans. All this and so much more combine to create a lifestyle that has not yet been seen in this area.</p>\r\n<p>&nbsp;</p>\r\n<p>Virtually everything you could desire is just steps away from your new home at Sri mitra&nbsp;&rsquo;&rsquo;ï»¿<strong><cite>Symphony&rsquo;&rsquo;&nbsp;ï»¿&nbsp;</cite></strong>nearby and seemingly endless recreation, entertainment, shopping and dinning offers you a life of exciting convenience just outside your doorstep. It&rsquo;ï»¿s the perfect accent to the relaxed urban lifestyle that awaits you inside new beautifully designed apartment home.</p>\r\n<p>&nbsp;</p>\r\n<p>Sri mitra symphony is an elaborate composition of architectural orchestra with a total of well designed vaastu complaint 116 homes planned in a location which is so pivotal and strategic in terms of proximity to the offices, schools/other educational institutions, range of prominent malls, other commercial entities, hospitals, etc etc clubbed with whole range of amenities planned, one surely soaks in the feelings of value for money for which one has to travel miles off main happening areas. At sri mitra symphony, the construction is 100% as per the government sanction plan with no deviations and quality specifications, there by catering to large segments of actual users.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Project Summary :-</strong></p>\r\n<p>&nbsp;Location : Hoodi circle ,hoodi village [ near ITPL]</p>\r\n<p>&nbsp;Land Area : 1.5 Acres</p>\r\n<p>&nbsp;No. of Floors&nbsp; : Ground&nbsp; level parking with 4 floors</p>\r\n<p>&nbsp;No. of Units :&nbsp; 116</p>\r\n<p>&nbsp;</p>\r\n<p>Area Range :</p>\r\n<p>&nbsp;3 BHK- 1585 sft to 1725 sft</p>\r\n<p>&nbsp;2.5 BHK &ndash; 1305 sq.ft</p>\r\n<p>&nbsp;2 BHK -1025 sq.ft to 1200 sq.ft</p>\r\n<p>&nbsp;1BHK- 710 sq.ft to 805 sq.ft</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;POSSESSION</strong>:-</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;BLOCK B &ndash; DEC 2013 [ 2 &amp; 3 bhks ] [ successfully sold ]</p>\r\n<p>&nbsp;BLOCK A &ndash; DEC&nbsp; 2014&nbsp; [1 ,2, 3 bhks ] [ bookings open ]</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>APPROVALS</strong>:-</p>\r\n<p>&nbsp;&nbsp;BBMP, LIC, SBI, HDFC</p>\r\n<p>&nbsp;Basic price - Rs 3200/- * sq.ft area</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<strong>Additional charges:-</strong></p>\r\n<p>&nbsp;Car parking &ndash; 2,00,000/-</p>\r\n<p>&nbsp;Bwssb &amp; Kptcl &ndash;&nbsp; Rs 150/- per sq.ft [ 2 &amp; 3 bhks ]</p>\r\n<p>&nbsp;Bwssb &amp; Kptcl &ndash; Rs 1.5 lakhs [ fixed ]</p>\r\n<p>&nbsp;Other amenities- 1.5 lakhs</p>\r\n<p>&nbsp;VAT &amp; SERVICE TAX&nbsp; 8.6 %</p>\r\n<p>&nbsp;legal fees&nbsp;&nbsp;&nbsp; 18000/-</p>\r\n<p>Excluding REGISTRATION chargesï»¿</p>\r\n<p>&nbsp;</p>\r\n<p>SHAFIQ / LAXMIKANTH REDDY<br />SALES MANAGER<br />SRI MITRA BUILDERS &amp; DEVELOPERS</p>\r\n<p>9972119080 ï»¿ï»¿</p>\r\n</div>', '14-8-2012'),
(27, 21, 'Noves Square', 'Thanisandra Main Road', 'Apartment', 'savefiles/banner_1351659849.jpg', 'f27Noves Square2.jpg', '<p><span><strong>ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿Welcome to Noves Square</strong>&nbsp;<br /><br /> Noves Square is situated in north Bangalore, a new world of silicon valley of India, behind Manyatha Tech park at Thanisandra Main Road. Brought to you by well-known builders CVR INFRA, with decades experience in state-of-the-art construction and promoting in construction field.<br /><br />A new passion of aesthetics and premium sprinkled with lap of nature exotic freshness, that place that will impress you to living there! <br /><br />Noves Square is built by no common wall concept for peaceful and natural sunlight, and also adheres to the basic principles of vaastu. <br /><br />It comprises of Exclusive two and three BHK homes with a retail complex. It is surrounded by IT Parks/SEZ, International Schools, Hospitals and shopping malls. The International Airport is just 15 minutes&rsquo; drive from the location.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span><strong>Specifications :</strong><br /><br /> <strong>Structure</strong> <br />R.C.C framed structure masonry walls of concrete cement blocks of 6&rsquo;&rsquo; &amp; 4&rsquo;&rsquo;&nbsp;<br /><br /> <strong>Flooring</strong> <br />2&rsquo; x 2&rsquo; vitrified tiles for entire apartment, Granite/vitrified tiles for lobby. Balconies with anti skid /rustic tiles.<br /><br /> <strong>Kitchen</strong> <br />Granite counter with glazed tiles dado upto 2 feet height. Stainless steel single bowl drain board.<br /><br /> <strong>Toilets</strong> <br />Anti skid tiles for flooring, glazed tiles for walls up to 7 feet height. Concealed plumbing lines with quality C.P. Fittings of Jaquar, Crabtree or equivalent . Sanitary ware of Hindware or Parryware.<br /><br /> <strong>Painting</strong> <br />Plastic emulsion for interior walls with puty finish. Apex and stucco or equivalent for exterior walls.<br /><br /> <strong>Doors &amp; Windows</strong> <br />Main door teak wood frame with skin panelled shutter. Otherdoors: Sal wood frame with termite resistant flush shutters. Aluminium / UPVC windows<br /><br /> <strong>Electrical</strong> <br />Concealed conduct wiring with copper wires. Modular switches. AC points in all bedrooms. TV points in living &amp; master bedroom. Geyser points in all bath rooms.<br /><br /> <strong>Water</strong> <br />Around the clock water facility.<br /><br /> <strong>Lifts</strong> <br />1 lift of 6 Passengers<br /><br /> <strong>Network points</strong> <br />Network and Telephone points provided in Living and Master bedroom.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span><strong>Contact us :</strong>&nbsp;<br /> <br />Registered Office:<br /> Sy No.67, Next to Diana College,<br /> Thanisandra Main Road,<br /> Bangalore - 560 077,<br /><br /> Phone : 96118 37333 , 96117 62555.<br />&nbsp;Email : noves@cvrinfra.com</span></p>\r\n<p>&nbsp;<a href=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;http:/www.cvrinfra.com\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">www.cvrinfra.comï»¿ï»¿</a></p>', '31-10-2012'),
