INSERT INTO `knowledge_house` (`id`, `content`, `title`, `update_date`, `img`, `discription`) VALUES
(176, '<p>\r\n  </p>\r\n<p class="sub_title_1" xss=removed>\r\n Shapes of the Lot or Land</p>\r\n<p xss=removed>\r\n Vastu Shastra recommends square or rectangular shapes of lands. However, since perfectly shaped lands are hard to come by, vastu recommends what is known as the Sherdah or one where the land is wider in front and coming out narrower at the rear. There is also the favorable vastu known as Gaumukhi wherein the front part is narrower compared to the rear part where the lot is wider.</p>\r\n<p class="sub_title_1" xss=removed>\r\n Shapes of the Lot or Land</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  A lot facing Northeast is a good site for homes, factories, and offices.</li>\r\n <li xss=removed>\r\n  A lot facing Northwest is ideal for trading, business, and industrial sites.</li>\r\n <li xss=removed>\r\n  A lot facing Southeast is good for chemical, petro-chemical, and electricity-related industries.</li>\r\n <li xss=removed>\r\n  A lot facing Southwest can bring good business for night time activities.</li>\r\n <li xss=removed>\r\n  Plots facing a road in more than one direction can also be significant in vastu principles.\r\n  <ul xss=removed>\r\n   <li xss=removed>\r\n    Land facing the West road brings fame and popularity.</li>\r\n   <li xss=removed>\r\n    Land facing a South road is ideal for business ventures.</li>\r\n  </ul>\r\n </li>\r\n <li xss=removed>\r\n  Plots facing two-side roads :\r\n  <ul xss=removed>\r\n   <li xss=removed>\r\n    Lots facing North and East roads are good for overall prosperity.</li>\r\n   <li xss=removed>\r\n    Lots facing East and South roads foretell prosperity for female residents.</li>\r\n   <li xss=removed>\r\n    Lots facing South and West roads as well as those facing North and South roads will provide moderate fortune.</li>\r\n   <li xss=removed>\r\n    Lots facing West and North roads are considered as prosperous lands.</li>\r\n  </ul>\r\n </li>\r\n <li xss=removed>\r\n  Lots facing roads on three sides, one side of which leads to a road end or facing a T-junction are considered as not ideal or weak plots.</li>\r\n <li xss=removed>\r\n  The best plot of all is the lot facing roads on all sides.</li>\r\n</ul>\r\n<p>\r\n  </p>\r\n<p class="sub_title_1" xss=removed>\r\n The Quality of Soil</p>\r\n<p>\r\n  </p>\r\n<p xss=removed>\r\n Land that has good soil quality is perfect for cultivation where agricultural production can prosper. Land with too many rocks, worms, humus, and thorny trees are not promising sites. Black and clay-like soil is hardly suitable for building sites which is also true for soil with crumbly rock composition. Soil considered as perfect for construction use are those that are yellowish in color.</p>\r\n<p xss=removed>\r\n Vastu Shastra also gives importance to the different debris materials found in the soil during excavation processes of construction. Vastu guiding principles make use of them as indicators as to how the land fared during the past.</p>\r\n<p xss=removed>\r\n Listed below are the equivalent interpretations for each material dug out of the soil during excavation proceedings:</p>\r\n<p class="sub_title_1" xss=removed>\r\n Effects of Roads near the Plot</p>\r\n<p xss=removed>\r\n North / Northeast - Ideal for women and for business activities as this will ensure wealth</p>\r\n<p xss=removed>\r\n Stone - Abundance of wealth</p>\r\n<p xss=removed>\r\n Bricks - All types of riches and possessions in the future</p>\r\n<p xss=removed>\r\n Copper or metals - Affluence in life</p>\r\n<p xss=removed>\r\n Coal - Illnesses and loss of health and wealth Hindrance to</p>\r\n<p xss=removed>\r\n Bones of animals - future developments Stumbling blocks to progress in</p>\r\n<p xss=removed>\r\n Snake or Scorpion - construction Damage to wealth and lessening the</p>\r\n<p xss=removed>\r\n Anthill or Termites - longevity of life Death leading to pointless expenses</p>\r\n<p xss=removed>\r\n Straw or Eggs Cotton - Grief</p>\r\n<p xss=removed>\r\n Pieces of wood - Need to vacate the place</p>\r\n<p xss=removed>\r\n Skull - Intense quarrels and litigation procedures</p>\r\n<p xss=removed>\r\n Horns of cow Gold or - Wealth and abundant possessions</p>\r\n<p xss=removed>\r\n silver coins Zinc or - All kinds of comforts and luxuries</p>\r\n<p xss=removed>\r\n brass Rugs or torn - Wealth and comforts</p>\r\n<p xss=removed>\r\n clothes Iron or steel pipes - Conflict, quarrels, and strife</p>\r\n<p xss=removed>\r\n pipes - Death or Extinction</p>\r\n<p xss=removed>\r\n East / Northeast - Promotes upward trend in life especially among men; useful for newspaper offices / presses / photo studios / media industries, and residences</p>\r\n<p xss=removed>\r\n South / Southeast - Best for women as it brings happiness as well as excellencein finance</p>\r\n<p xss=removed>\r\n East / Southeast - Tends to make the residents greedy but brings more expenses</p>\r\n<p xss=removed>\r\n North / Northwest - Instability and lack of discipline and may lead to unlawful deals</p>\r\n<p xss=removed>\r\n West / Northwest - Good for businessmen with its quality to improve attitude and behavior</p>\r\n<p xss=removed>\r\n South / Southwest - Indicates accidents and bad habits for women and can lead to trouble</p>\r\n<p xss=removed>\r\n West / Southwest - Indicates frequent feuds, strife, and financial instability</p>\r\n<p class="sub_title_1" xss=removed>\r\n The First Construction Goal: The Well or Water Source</p>\r\n<p xss=removed>\r\n The first construction project to deal with in building a new house is the well or water source. It is prescribed under vastu shastra that the water source will be dug on the North or Northeast side of the property. To locate the most ideal site to dig the well, you should draw a line from the Southeast corner to Northeast corner and mark your well to the right or left of the line and not on it.</p>\r\n<p xss=removed>\r\n Below are the vastu guidelines for the Well:</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  To ensure that the water derived from the well is pure, a ritual should be first performed on the land at an astrologically favorable time. A downward-facing constellation is said to be the best astrological time to dig the well.</li>\r\n <li xss=removed>\r\n  Traditionally and ideally, the well should be round.</li>\r\n <li xss=removed>\r\n  It is located either on the Southeast corner or Northeast corner in a spot where it will be exposed to five hours of sunlight each day.</li>\r\n <li xss=removed>\r\n  Wells are not recommended to serve two properties.</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Compound Walls and Gates</p>\r\n<p xss=removed>\r\n The compound walls and gates are required to be built before the actual construction of the house or building goes underway. Favorable constellations are also influential during the actual construction of these walls and the agreeable days on which to commence the construction should fall on a Monday, Wednesday, Thursday, or Friday. Construction of these compound walls should begin from the Southwest side.</p>\r\n<p xss=removed>\r\n As a matter of vastu shastra practice, the compound wall should not be higher than the house to be built. The height of these walls if possible should not be uniform; the Southwest part of the wall should be higher than the rest. Other provisions require that the walls on the North and East side should be shorter by 21 inches than the wall on the West and South sides.</p>\r\n<p xss=removed>\r\n However, if this is not possible, the North and East sides should maintain at least a lowered difference of 3 inches than the West and South sides. For this matter, it is ideal to install two gates for the compound so that evil forces that enter one gate will make an exit to the other gate. Take note however that the South side should not be used for gates.</p>\r\n<p xss=removed>\r\n Main Doors and Windows:</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  Make sure they are located in the East. Placements may be modified as Northeast, East of Northeast, or North of Northeast. This location allows the positive energy to flow into the room. As an added feature it even suggests the swastika symbol to be placed on the door aside from suggesting heavy decorations as adornment.</li>\r\n <li xss=removed>\r\n  Vastu house construction recommends that the house should have two points of entry. They should not be set in a straight line and the one which is used as an exit door should be smaller and must have only one shutter.</li>\r\n <li xss=removed>\r\n  The main door being larger than the other doors should be equipped with two shutters. A recommended material for a door to bring in good balance is teak.</li>\r\n</ul>\r\n<p xss=removed>\r\n For a main entrance to be ideal, vastu shastra prescribes the following:</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  The main entrance should not face a wall and a door opening to the next room should be provided</li>\r\n <li xss=removed>\r\n  Make sure that a shadow does not loom on the main door</li>\r\n <li xss=removed>\r\n  It is not advisable to position the main entry point at the center of the house or in the extreme corners</li>\r\n <li xss=removed>\r\n  It is also important in vastu principles that the main entrance should not face road intersections or dead end roads</li>\r\n <li xss=removed>\r\n  There shouldn&#39;t be large trees or imposing lamp posts that appear to be blocking the entrance</li>\r\n <li xss=removed>\r\n  If there is a short flight of stairs leading to the main entrance, the number of steps should be kept even</li>\r\n <li xss=removed>\r\n  If a main entrance door is located in the south side of the building, remember that it is best if a balcony or veranda is affixed to it</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Living Room</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  In keeping with the traditional spots for living room you can have it at the forefront of the house, wide, and as large as you please. This is because the living room ranks first in the vastu shastra household. However, take heed as to where the dwellers are supposed to face while inside the room. Facing the East can give good results while facing the North could also be beneficial provided the living room is situated at the front side instead of front center.</li>\r\n <li xss=removed>\r\n  Don&#39;t construct your living room on the west side or south side of your front room as these spots will not give-off the correct vibrations of the cosmic energy.</li>\r\n <li xss=removed>\r\n  You can keep more than one door for living rooms in accordance with vastu shastra but keep it in the right location. Keep this room beautiful and decorate as well as you can to promote a life with little strife and with much enjoyment.</li>\r\n <li xss=removed>\r\n  Be careful where you position yourself if you are in this room. If it will be used for discussions or business deals observe your seating arrangements. As the owner, take a seat that faces towards the East and your guests or business associates should sit facing the south or west. This seating arrangement will give you victory on the negotiation aspects.</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Bedrooms</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  For male family members, vastu places their bedrooms in the West or Northwest since this section holds commanding and authoritative forces.</li>\r\n <li xss=removed>\r\n  For female family members, the South or Southeast will ensure good health and happiness if their bedroom doors and windows are located here.</li>\r\n <li xss=removed>\r\n  Main or Master&#39;s Bedroom is suitably located at the Southwest.</li>\r\n <li xss=removed>\r\n  Bedrooms of adult married children are also ideally placed here at the Southwest.</li>\r\n <li xss=removed>\r\n  For that matter if there is a second story level, the master&#39;s bedroom should be located on the said second level. It would be unwise to choose this area for children&#39;s bedroom as it is said to cause trouble.</li>\r\n <li xss=removed>\r\n  It is not advisable for newly wed couples to use the east side for their bedroom as it is said to bring bad luck.\r\n  <p xss=removed>\r\n   The following bed habits, norms and decors should be observed:</p>\r\n  <ul xss=removed>\r\n   <li xss=removed>\r\n    If one is sleeping as a guest, he should not sleep with his head facing north. Otherwise the bedroom owner should sleep heads facing east or south while sleeping</li>\r\n   <li xss=removed>\r\n    As one rises out of bed he should set his right foot first on the floor.</li>\r\n   <li xss=removed>\r\n    If one studies in the room the east side should be used to achieve best results.</li>\r\n   <li xss=removed>\r\n    Northwest and Southside of the bedroom is ideal place for putting the wardrobes, while TVs and heaters should be located in the Southeast corner</li>\r\n   <li xss=removed>\r\n    If there should be a bathroom within the room, it is best to put it in the west or north sides of the room.</li>\r\n   <li xss=removed>\r\n    It is not advisable to put safes in the bedroom but if necessary, place the safe on the south wall.</li>\r\n   <li xss=removed>\r\n    Place something on the southwest corner of the room since it is not advisable to keep this spot empty.</li>\r\n   <li xss=removed>\r\n    Photos, calendars, idols, or statues should not be kept in bedrooms.</li>\r\n   <li xss=removed>\r\n    Never keep the room in total darkness, instead keep a night bulb lighted.</li>\r\n   <li xss=removed>\r\n    Recommended colors for bedroom walls are light rose, dark blue, or dark green but never white or light yellow.</li>\r\n  </ul>\r\n </li>\r\n <li xss=removed>\r\n  Vastu provides the following pointers for the children&#39;s bedroom:\r\n  <ul xss=removed>\r\n   <li xss=removed>\r\n    Children&#39;s bedrooms are best located in the Northwest or Eastside of the house.</li>\r\n   <li xss=removed>\r\n    There should be vacant spaces in the North side and East side in a children&#39;s bedroom. If a space could not be provided, place the child&#39;s bed at the South, West, or Southwest corner.</li>\r\n   <li xss=removed>\r\n    The directions of their head while laid in their beds should be on the East side with the legs placed towards the west side. This is said to attract energy that will bring intelligence and memory power.</li>\r\n  </ul>\r\n </li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Bathroom</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  Vastu places the West and South for the bathroom and provides that the flow of its drain should be towards Northeast. This position has something to do with the sun falling on the body after a good bath.</li>\r\n <li xss=removed>\r\n  Positioning of the toilet should be at the West or Northwest of the room at a level of 30 to 60 cm above the ground.</li>\r\n <li xss=removed>\r\n  If the bathroom is structured as an attachment to the building, it should be positioned on the West or Northwest and never on the Northeast side.</li>\r\n <li xss=removed>\r\n  Bathtubs and sinks are best located on the Northeast, North, or East side of the room.</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Dining Room</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  Vastu recommends the dining room to be near or attached to the kitchen and situated either at the Southeast, Northwest, or Northeast corner of the house. To encourage profitability coming in, place the dining room at the West side of thebuilding.</li>\r\n <li xss=removed>\r\n  It is best to keep in mind not to place your kitchen at the Southwest corner of the house since it is said to obstruct financial increase and brings certain detriments to the health of its dwellers.</li>\r\n <li xss=removed>\r\n  You can place the dining table at the center of the house but make sure that it is not situated towards the Southwest corner</li>\r\n <li xss=removed>\r\n  Positioning the kitchen on the ground floor and the dining room on the upper floor is said to be improper since carrying food while crossing stairs is in itself improper.</li>\r\n <li xss=removed>\r\n  During mealtime, the proper table places should have the head of the family facing the East while the rest should either face East, West, or North. It is said that placing a family member in a position facing the South will result to petty quarrels.</li>\r\n <li xss=removed>\r\n  Make sure that the door of the dining room area does not face the main entrance of the room.</li>\r\n <li xss=removed>\r\n  The dining hall area must have a door to the East, North, or West and should not be decorated with arches.</li>\r\n <li xss=removed>\r\n  Dining tables should either be square, rectangular in shape or never round, egg-shaped, or irregular. Dining tables attached or folded against the wall are not advisable.</li>\r\n <li xss=removed>\r\n  There should be water and wash basin in the East or North but never in the Southeast or Southwest corner of the room.</li>\r\n <li xss=removed>\r\n  Landscape paintings or portraits of nature will permit a happy atmosphere in the dining area. In addition keep the dining room positive by painting the walls with light blue, yellow, saffron, or light green hues.</li>\r\n <li xss=removed>\r\n  Toilets are best kept as not annexed to the dining room although there&#39;s no harm for the laundry room to be near the dining room.</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Kitchen</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  Position the kitchen at the Southeast, although placing it in the Northwest can also be desirable. Whichever of these locations get occupied by the kitchen should also consider the cook who should be placed at the East. Avoid using the Northeast part of the house for kitchens; it&#39;s bound to bring negative vibrations concerning family relationships and finances.</li>\r\n <li xss=removed>\r\n  The location of the sink where the tap water should be located at the Northeast and must not be near the stove or fire area since situations like this will hold back peace and mutual love within the family.</li>\r\n <li xss=removed>\r\n  It is a must to avoid placing the kitchen at the Northeast corner since conflict among family member will always take place.</li>\r\n <li xss=removed>\r\n  Storage shelves and attics should be in the South and West particularly those that are heavy.</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Pooja or the Prayer Room</p>\r\n<p xss=removed>\r\n The pooja room is ideally placed at the Northeast corner of the house preferably on the ground floor; if this isn&#39;t possible, alternative areas can be East, South, and West but never on the Northwest.</p>\r\n<p xss=removed>\r\n Although we may explore areas here as to where we can have the Gods give more attention to our prayers, we should not forget the fact that our Gods can be prayed too almost anywhere because it is our faith and devotion that will be looked upon.</p>\r\n<p xss=removed>\r\n Pictures and icons of the gods to be worshipped should face either the East or the West, while the person in worship should face either the East or the North. The altar should not be attached to the wall but instead kept about 2.5 cm away from the wall.</p>\r\n<p xss=removed>\r\n If possible, it is good for a Pooja room to be pyramid in shape sloping inward and pointing upwards to the roof. But it is more important for the pooja room to have a door with two shutters.</p>\r\n<p xss=removed>\r\n Pooja room should not share a common wall with the toilet or be placed opposite the bathroom or the toilet. This is in keeping with the pooja room being kept fragrant aside from being kept clean and clutter free since the room is a receptacle for blessings. It shouldn&#39;t be situated above electrical appliances or gas stoves either as there are a lot of external energy emanating from these gadgets.</p>\r\n<p xss=removed>\r\n White, light blue, or light yellow are the perfect colors for the pooja room</p>\r\n<p class="sub_title_1" xss=removed>\r\n The Study Room</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  The Northeast of the house is the perfect spot for a study room. To make its location a more beneficial, place it next to the pooja or prayer room. When using this room be sure that you&#39;re facing East or North.</li>\r\n <li xss=removed>\r\n  The library section should take the West side but not in the corners. Avoid placing your bookshelves in the Northwest or Southwest; having them on the East, West, or North of the room will give better benefits.</li>\r\n <li xss=removed>\r\n  The Northeast corner is the best for a study room. If the study room and place of worship room are adjacent then it is considered most beneficial.</li>\r\n <li xss=removed>\r\n  Provide this room with a two-shuttered door located at the North, Northeast, or West of the room while set your windows on the East, North, or West of the room.</li>\r\n <li xss=removed>\r\n  Similar to the prayer room, setting up a pyramidal study room will allow a good place for meditation.</li>\r\n <li xss=removed>\r\n  Have the study room painted either with white, sky blue, cream, or light green to give it the right touch.</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Swimming Pool (or Underground Water Tank, Wells, and Bore-Well)</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  The swimming pool, underground water tank, wells, and bore-wells are ideally constructed in the East or Northeast of the property; another choice would simply be the North side as these are favorable spots outside of the house.</li>\r\n <li xss=removed>\r\n  As water denotes a positive flow of cash, bank balances, and good credit for the residents, take note that the flow of the swimming pool or water item should begin from the Northeast side going to the East side or from the Northeast side going to the North side.</li>\r\n <li xss=removed>\r\n  For more positive results, the slope inside a swimming pool should begin from the West to the East if the pool is located at the North side. On the other hand, if the pool is located on the East side of the property, the slope in the swimming pool should begin from the South to the North.</li>\r\n <li xss=removed>\r\n  Wells and tube wells are also ideally placed on the Northeast corner of the property; otherwise the home owner is bound to suffer from financial losses based on Vastu Shastra studies.</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Overhead Water Tank</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  Contrary to underground water tanks, the overhead water tank should be placed Southwest as the best location or West corner as an alternative location in the corner buildings. Neither should the overhead water tank be placed in the middle of the building roof.</li>\r\n <li xss=removed>\r\n  Placing the overhead water tank in the Northwest corner is acceptable only if the tank is small and located about a meter away from the building&#39;s corner roof.</li>\r\n <li xss=removed>\r\n  In the correct location, the overhead water tanks should be placed elevated on a platform about a meter from roof level.</li>\r\n <li xss=removed>\r\n  If possible choose overhead tanks that are light colored and not made of plastic. If plastic tanks could not be avoided, make it black or dark blue plastic to avoid microbial growth usual in water containers.</li>\r\n <li xss=removed>\r\n  Ideally, there should be a separate water tank for the kitchen where water is used for food handling and for the bathroom where water is used for general cleaning purposes.</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Balconies and Verandahs</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  The balcony can achieve good health and wealth if it is incorporated at the Northeast of a house being constructed. If the house is already constructed and a balcony was placed in the Southwest, this should be corrected by enclosing it with glass or screen affixtures.</li>\r\n <li xss=removed>\r\n  The floor or roof of a balcony should be at a lower level than the floor of the main building.</li>\r\n <li xss=removed>\r\n  A slanted tin balcony roof where the corners of the structure are not rounded.</li>\r\n <li xss=removed>\r\n  Avoid arches and planting creepers on the verandah while flower pots should be kept in minimal sizes.</li>\r\n <li xss=removed>\r\n  Seating arrangements on the verandah should be set on the South or West sides. While provisions for shoes to be removed upon entering the house from point of the verandah, should be at the Northeast.</li>\r\n</ul>\r\n<p class="sub_title_1" xss=removed>\r\n The Staircase</p>\r\n<ul xss=removed>\r\n <li xss=removed>\r\n  A staircase which is considered as a heavy installation is preferably situated in the South or West part of the house. Do not utilize the North or East part of the house for a staircase as it denotes conflict between heavy objects being placed on light zones. Should a home dweller insist on putting the staircase on the North or East side of the house, it is highly probable that the household will suffer loss of wealth.</li>\r\n <li xss=removed>\r\n  The following are some Vastu Shastra tips in installing a staircase for your house:</li>\r\n <li xss=removed>\r\n  In coming up with a staircase, the total number of stairs should not end with a zero, for example 10 or 20 steps. Neither should they end with even numbers since Vastu Shastra believes that this makes possible the idea of starting your climb with the right foot. The right foot is equated with gain while the left foot is associated with loss.</li>\r\n <li xss=removed>\r\n  Circular stairways are not recommended.</li>\r\n <li xss=removed>\r\n  The doorway meeting the top of the stairway should be at least 20 cm lower than the doorway located at the bottom of the stairs.</li>\r\n <li xss=removed>\r\n  Broken stairs should immediately undergo repairs.</li>\r\n</ul>\r\n', 'Vasthu Tipss', '2012-10-08', 'Knowledge_House/vasthu_tips.jpg', 'Geographic Qualities of the Vastu Land'),
